{

    internal InnerDataflowEndpointGroupDataflowEndpointFactory EndpointFactory { get; set; }

    internal InnerDataflowEndpointGroupAwsGroundStationAgentEndpointFactory AwsGroundStationAgentEndpointFactory { get; set; }

    internal InnerDataflowEndpointGroupSecurityDetailsFactory SecurityDetailsFactory { get; set; }

    protected override Humidifier.GroundStation.DataflowEndpointGroupTypes.EndpointDetails Create()
    {
        var endpointDetailsResult = CreateEndpointDetails();
        factoryAction?.Invoke(endpointDetailsResult);

        return endpointDetailsResult;
    }

    private Humidifier.GroundStation.DataflowEndpointGroupTypes.EndpointDetails CreateEndpointDetails()
    {
        var endpointDetailsResult = new Humidifier.GroundStation.DataflowEndpointGroupTypes.EndpointDetails();

        return endpointDetailsResult;
    }
    public override void CreateChildren(Humidifier.GroundStation.DataflowEndpointGroupTypes.EndpointDetails result)
    {
        base.CreateChildren(result);

        result.Endpoint ??= EndpointFactory?.Build();
        result.AwsGroundStationAgentEndpoint ??= AwsGroundStationAgentEndpointFactory?.Build();
        result.SecurityDetails ??= SecurityDetailsFactory?.Build();
    }

} // End Of Class

